
SELECT MIN("corporation"."state_prov") as agg_0 FROM "region" LEFT OUTER JOIN "corporation" ON "region"."region_no" = "corporation"."region_no" LEFT OUTER JOIN "provider" ON "region"."region_no" = "provider"."region_no" LEFT OUTER JOIN "member" ON "region"."region_no" = "member"."region_no" LEFT OUTER JOIN "payment" ON "member"."member_no" = "payment"."member_no" LEFT OUTER JOIN "charge" ON "member"."member_no" = "charge"."member_no"  WHERE "provider"."expr_dt" NOT LIKE '%10:41:24%' AND "payment"."member_no" BETWEEN 1290 AND 4895 AND ("payment"."payment_dt" IN ('1999-09-02 00:00:00') OR "payment"."payment_no" BETWEEN 1309 AND 13583 OR "payment"."payment_dt" IN ('1999-10-03 00:00:00')) AND "region"."country" IN ('Ja') AND "charge"."member_no" IS NOT NULL;